<template>
  <div>
    <div>
      <div :style="{ backgroundColor: this.averageColor }">
        <v-container class="py-10">
          <v-row no-gutters>
            <v-col cols="3">
              <v-card tile width="100%">
                <v-card-actions class="pa-0">
                  <img
                    id="image"
                    class="image"
                    src="data:image/jpeg;base64,"
                  />
                </v-card-actions>
              </v-card>
            </v-col>
            <v-col class="mt-6">
              <v-row no-gutters class="pl-3">
                <v-col cols="11" class="display-4">
                  Tropical Island
                </v-col>
                <v-col class="d-flex justify-end" cols="1">
                  <v-btn @click="editable = !editable" icon
                    ><v-icon>mdi-pencil</v-icon></v-btn
                  >
                </v-col>
                <v-col cols="12" class="mt-6 pl-1 smallDescription">
                  A brand new tropical information app, which will provide a lot
                  of information like weather, customs, and even more about a
                  lot of different tropical islands.
                </v-col>
                <v-col
                  cols="12"
                  class="mt-6 d-flex fill-height"
                  align-self="end"
                >
                  <tag-chip
                    color="rgba(255,255,255,0.9)"
                    :editable="editable"
                    text="Javascript"
                    text-size="10px"
                    text-color="#285E61"
                    height="20px"
                    @clicked="tagClicked"
                  />
                  <tag-chip
                    color="rgba(255,255,255,0.9)"
                    v-if="editable"
                    :editable="false"
                    text="+"
                    text-size="10px"
                    text-color="#285E61"
                    height="20px"
                    @clicked="tagClicked"
                  />
                </v-col>
              </v-row>
            </v-col>
          </v-row>
        </v-container>
      </div>
      <v-container fill-height>
        <v-tabs color="#2680C2">
          <v-tab class="text-capitalize"
            ><v-icon class="mr-2">mdi-crop-square</v-icon>Overview</v-tab
          >
          <v-tab class="text-capitalize"
            ><v-icon class="mr-2">mdi-account-multiple-outline</v-icon
            >Collapporators</v-tab
          >
          <follow-button color="#DCEEFB" text-color="#2680C2" />
          <like-button
            @clicked="updateLike()"
            color="#DCEEFB"
            text-color="#2680C2"
            :likes="2"
          />
        </v-tabs>
      </v-container>
    </div>
  </div>
</template>

<script>
import TagChip from '@/components/project/TagChip'
import LikeButton from '@/components/buttons/LikeButton'
import FollowButton from '@/components/buttons/FollowButton'
export default {
  name: 'Projectview',
  components: { TagChip, LikeButton, FollowButton },
  data() {
    return {
      averageColor: null,
      editable: false
    }
  },
  mounted() {
    this.averageColor = this.getAverageRGB()
  },
  methods: {
    getAverageRGB: function() {
      var blockSize = 5,
        imgEl = document.getElementById('image'),
        defaultRGB = { r: 0, g: 0, b: 0 },
        canvas = document.createElement('canvas'),
        context = canvas.getContext && canvas.getContext('2d'),
        data,
        width,
        height,
        i = -4,
        length,
        rgb = { r: 0, g: 0, b: 0 },
        count = 0
      if (!context || imgEl === null) {
        return defaultRGB
      }

      height = canvas.height =
        imgEl.naturalHeight || imgEl.offsetHeight || imgEl.height
      width = canvas.width =
        imgEl.naturalWidth || imgEl.offsetWidth || imgEl.width

      context.drawImage(imgEl, 0, 0)

      try {
        data = context.getImageData(0, 0, width, height)
      } catch (e) {
        return defaultRGB
      }

      length = data.data.length

      while ((i += blockSize * 4) < length) {
        ++count
        rgb.r += data.data[i]
        rgb.g += data.data[i + 1]
        rgb.b += data.data[i + 2]
      }

      rgb.r = ~~(rgb.r / count)
      rgb.g = ~~(rgb.g / count)
      rgb.b = ~~(rgb.b / count)

      return 'rgb(' + rgb.r + ',' + rgb.g + ',' + rgb.b + ', 0.5)'
    },
    updateLike() {
      console.log('Liked')
    },
    tagClicked(tagname) {
      console.log(tagname)
    }
  }
}
</script>

